import {mergePDFs} from "../index";

describe('Merge PDFs API', () => {
  it('should merge 2 PDF files and create new one', async () => {
    const file1Content = "";
    const file2Content = "";

    const pdfContent = await mergePDFs(Buffer.from(file1Content, "base64"), Buffer.from(file2Content, "base64"))
      .then((base64Content) => base64Content)
      // fs.writeFileSync(`./${new Date().toISOString()}_transformed.pdf`, Buffer.from(base64Content, "base64")))
      .catch((reason) => console.log(reason));

    expect(pdfContent).not.toBeNull();
  });
});
